import React from "react";
import "./App.css";
import JwtControler from "./Controlers/Jwt.controler.js";

class App extends Component {
    state = {
        jwtControler: new JwtControler(),
        token: "no token",
    };
    render() {
        return (
            <div className="App">
                <label>{state.token}</label>
                <button
                    onClick={() => {
                        state.jwtControler.authenticate("admin", "admin");
                        this.setState({ token: state.jwtControler.getToken() });
                    }}
                >
                    It hurts
                </button>
            </div>
        );
    }
}

export default App;
